(()=>{"use strict";jQuery(document).ready(function(a){const t=a(".price-list");t.on("click",e=>{t.find(".acc-item").each((c,t)=>{a(t).is(a(e.target).closest(".acc-item"))||((t=a(t)).find(".acc-content").hide(),t.find(".acc-btn").removeClass("active"))});var c=a(e.target).closest(".acc-item");c.find(".acc-btn").hasClass("active")?(c.find(".acc-content").hide(),c.find(".acc-btn").removeClass("active")):(c.find(".acc-content").show(),c.find(".acc-btn").addClass("active"))})})})();